er var tom. Kontroller at NETTADRESSEN er riktig, og sjekk php.ini-konfigurasjonen din for å bekrefte at enten cURL eller allow_url_fopen er tilgjengelig. Hvis du bruker mellomrom til å avgrense flere nettadresser, kan det også være lurt å prøve å bruke rørtegnet i stedet. Berørt nettadresse:','Hide past events'=>'Skjul tidligere hendelser','Show past events'=>'Vis tidligere hendelser','Contact:'=>'Kontakt:','Resources:'=>'Ressurser:','Click for more...'=>'Klikk for mer...','Save to your calendar'=>'Lagre i kalenderen din','Cancelled'=>'Kansellert','The legacy parser option is deprecated and will be removed in a future update.'=>'Alternativet for eldre parser er utdatert og vil bli fjernet i en fremtidig oppdatering.','The "currentweek" shortcode attribute is deprecated. Please use view="week" in your shortcode instead.'=>'Kortkodeattributtet currentweek er avskrevet. Bruk view="week" i kortkoden i stedet.','The "legendinline" shortcode attribute is deprecated. Please use legendstyle="inline" in your shortcode instead.'=>'Kortkodeattributtet "legendinline" er avviklet. Vennligst bruk legendstyle="inline" i kortkoden din i stedet.','Cleared %1$s %2$s transient(s).'=>'Fjernet %1$s %2$s forbigående(r).','No %1$s transients were found.'=>'Ingen %1$s transienter ble funnet.','Your feed URL appears to contain HTTP Basic Authentication credentials. Try turning off the %1$s option under the %2$s tab above.'=>'URL-adressen til feeden din ser ut til å inneholde HTTP Basic Authentication-legitimasjon. Prøv å slå av %1$s-alternativet under %2$s-fanen ovenfor.','Use legacy feed request method'=>'Bruk den gamle metoden for feedforespørsel','%1$sThis URL points to a file in your Media Library.%2$s While you should be able to use this URL in an %3$s shortcode, it will be a static snapshot of the calendar at the time the file was created, and will not reflect any future updates to the source calendar. Please see our %4$sUser Guide%5$s for instructions on obtaining your correct dynamic feed URL.'=>'%1$sDenne URL-adressen peker til en fil i mediebiblioteket%2$s. Selv om du skal kunne bruke denne URL-adressen i en %3$s kortkode, vil det være et statisk øyeblikksbilde av kalenderen på det tidspunktet filen ble opprettet, og vil ikke gjenspeile eventuelle fremtidige oppdateringer av kildekalenderen. Se vår %4$sBrukerveiledning%5$s for instruksjoner om hvordan du får riktig URL-adresse for dynamisk feed.','Error: Could not resolve IP address for %1$s.'=>'Feil: Kunne ikke løse IP-adressen for %1$s.','Resolved IP address for %1$s:'=>'Løst IP-adresse for %1$s:','The text entered in the "Default shortcode" field is not a valid shortcode, and was not saved.'=>'Teksten som er angitt i feltet "Standard kortkode", er ikke en gyldig kortkode og ble ikke lagret.','%1$sSettings updated.%2$s You may need to refresh the page to see some changes.'=>'%1$s Innstillingene er oppdatert%2$s Det kan hende du må oppdatere siden for å se noen av endringene.','calendar event'=>'kalenderhendelse','The legacy feed request method is deprecated, and will be removed in an update in the near future. Please test your feeds with the legacy feed request method turned off.'=>'Den gamle metoden for å be om innmating er utdatert, og vil bli fjernet i en oppdatering i nær fremtid. Vennligst test innmatingene dine med den gamle metoden for innmating slått av.','Map'=>'Kart','Recurring event'=>'Gjentagende arrangement','Recurs every %1$s years'=>'Gjentar seg hvert %1$s år','Recurs yearly'=>'Gjentar seg årlig','Recurs every %1$s months'=>'Gjentar seg hver %1$s måned','Recurs monthly'=>'Gjentar seg månedlig','Recurs every %1$s weeks'=>'Gjentar seg hver %1$s uke','Recurs weekly'=>'Gjentar seg ukentlig','Recurs every %1$s days'=>'Gjentar seg hver %1$s dag','Recurs daily'=>'Gjentar seg daglig','The "url" property in your %1$s shortcode appears to contain HTML tags; most likely your URL has been turned into a clickable link. Your calendar may not display properly as a result. Please remove the clickable link in the shortcode.'=>'"URL"-egenskapen i %1$s-kortkoden ser ut til å inneholde HTML-koder; mest sannsynlig er nettadressen din omgjort til en klikkbar lenke. Det kan hende at kalenderen din ikke vises riktig som et resultat. Vennligst fjern den klikkbare lenken i kortkoden.','The r34ics_url_get_contents() function is no longer supported.'=>'Funksjonen r34ics_url_get_contents() støttes ikke lenger.','%1$sPlease note:%2$s %3$s version 10.6 changes the default options for several shortcode settings. In order to maintain consistency, these new defaults are %4$snot%5$s enabled when upgrading from an earlier version. If you would like to learn more about the changes please read our %6$sblog post%7$s, or to switch to the new defaults, turn on the %8$s option on the %9$s settings%10$s page.'=>'%1$sMerk:%2$s %3$s versjon 10.6 endrer standardalternativene for flere kortkodeinnstillinger. For å opprettholde konsistens er disse nye standardinnstillingene %4$sikke%5$s aktivert ved oppgradering fra en tidligere versjon. Hvis du vil vite mer om endringene, kan du lese %6$sblogginnlegget%7$s vårt, eller for å bytte til de nye standardinnstillingene, slå på alternativet %8$s på siden %9$sinnstillinger%10$s.','Use new parameter defaults (v.10.6)'=>'Bruk nye parameterstandarder (v.10.6)','%1$sPlease note:%2$s %3$s version 11.0 streamlines the way ICS feed URLs are retrieved. This change uses a standard built-in WordPress function, so it should be fully compatible with all existing installations. If you encounter any new issues after upgrading to version 11 or later, please visit the %4$sWordPress Support Forums%5$s for assistance.'=>'%1$sMerk:%2$s %3$s versjon 11.0 effektiviserer måten ICS feed-URL-er hentes på. Denne endringen bruker en standard innebygd WordPress-funksjon, så den skal være fullt kompatibel med alle eksisterende installasjoner. Hvis du støter på nye problemer etter at du har oppgradert til versjon 11 eller nyere, kan du gå til %4$sWordPress Support Forums%5$s for å få hjelp.','%1$sPlease note:%2$s %3$s version 11.5.14.2 introduces a new, more secure method for handling calendar parameters when loading via AJAX. Please clear any caching plugins you are using, to ensure that your calendars are loading properly with the new method.'=>'%1$sMerk:%2$s %3$s versjon 11.5.14.2 introduserer en ny, sikrere metode for håndtering av kalenderparametere når de lastes inn via AJAX. Fjern eventuelle hurtigbufringsplugins du bruker, for å sikre at kalenderne dine lastes inn på riktig måte med den nye metoden.','Add %1$s'=>'Legg til %1$s','Close'=>'Lukk','ICS Feed URL:'=>'ICS-feed-URL:','Be sure you are using a %1$ssubscribe%2$s URL, not a %3$sweb view%4$s URL.%5$s (Entering the URL directly in your web browser should download an %6$s file.)'=>'Pass på at du bruker en %1$sabonner%2$s-URL, ikke en %3$snettvisning%4$s-URL.%5$s (Hvis du skriver inn nettadressen direkte i nettleseren, bør du laste ned en %6$s-fil.)','Calendar Title:'=>'Kalendertittel:','Leave empty to use calendar&rsquo;s default title. Enter %1$s to omit title altogether.'=>'La det stå tomt for å bruke kalenderens standardtittel. Skriv inn %1$s for å utelate tittelen helt.','Calendar Description:'=>'Kalenderbeskrivelse:','Leave empty to use calendar&rsquo;s default description. Enter %1$s to omit description altogether.'=>'La stå tomt for å bruke kalenderens standardbeskrivelse. Skriv inn %1$s for å utelate beskrivelsen helt.','View:'=>'Vis:','month'=>'måned','list'=>'liste','week'=>'uke','Count:'=>'Antall:','Format:'=>'Format:','Leave %1$s blank to include all upcoming events. %2$s must be a standard %3$sPHP date format string%4$s.'=>'La %1$s stå tomt for å inkludere alle kommende arrangementer. %2$s må være en standard %3$sPHP-datoformatstreng%4$s.','Show event descriptions %1$s(change to a number in inserted shortcode to set word limit)%2$s'=>'Vis hendelsesbeskrivelser %1$s(endre til et tall i innsatt kortkode for å angi ordgrense)%2$s','Show event locations %1$s(if available)%2$s'=>'Vis arrangementssteder %1$s(hvis tilgjengelig)%2$s','Show event organizers %1$s(if available)%2$s'=>'Vis arrangementsarrangører %1$s(hvis tilgjengelig)%2$s','%1$sNote:%2$s Additional %3$sdisplay options%4$s are available by manually editing the shortcode after insertion.'=>'%1$sMerk:%2$s Ytterligere %3$svisningsalternativer%4$s er tilgjengelige ved å manuelt redigere kortkoden etter innsetting.','Insert %1$s'=>'Sett inn %1$s','Do even more with %1$s!'=>'Gjør enda mer med %1$s!','Calendar Builder'=>'Kalenderbygger','Configure all calendar settings with an easy visual interface... no need to manually type shortcodes.'=>'Konfigurer alle kalenderinnstillinger med et enkelt visuelt grensesnitt ... du trenger ikke å skrive inn kortkoder manuelt.','Additional Views and Enhanced Features'=>'Flere visninger og forbedrede funksjoner','New ways to display your calendar including Full, Up Next, Masonry, Month with Sidebar, Widget, and more. Additional capabilities are added to the core Month, Basic, List and Week views.'=>'Nye måter å vise kalenderen på, inkludert Full, Neste, Masonry, Måned med sidefelt, Widget og mer. Kjernevisningene Måned, Grunnleggende, Liste og Uke har fått flere funksjoner.','Customizer'=>'Tilpasser','Easily modify your calendar color palettes, fonts, and more, site-wide.'=>'Du kan enkelt endre kalenderens fargepalett, skrifttyper og mer på hele nettstedet.','ICS Events'=>'ICS-arrangementer','%1$sNew!%2$s Turns %3$s into a full calendar system. Create and manage events directly in WordPress and even integrate them seamlessly with your existing feeds.'=>'%1$sNy!%2$s Gjør %3$s om til et komplett kalendersystem. Opprett og administrer arrangementer direkte i WordPress, og integrer dem til og med sømløst med eksisterende feeds.','Visit %1$s to learn more.'=>'Besøk %1$s for å finne ut mer.','Go PRO!'=>'Gå PRO!','Getting Started'=>'Kom i gang','System Report'=>'Hent systemrapport','Save Changes'=>'Lagre endringer','Thank you for installing %1$s. Before creating your first calendar shortcode, please visit your %2$sGeneral Settings%3$s page and verify that your site language, timezone and date/time format settings are correct. See our %4$sUser Guide%5$s for more information.'=>'Takk for at du installerte %1$s. Før du oppretter din første kalenderkortkode, kan du gå til siden %2$sGenerelle innstillinger%3$s og kontrollere at innstillingene for språk, tidssone og dato-/klokkeslettformat er riktige. Se vår %4$sbrukerveiledning%5$s for mer informasjon.','Quick Start Guide'=>'Hurtigstartveiledning','An extensive %1$sUser Guide%2$s is available on our website. Below are some quick links to key resources in the documentation.'=>'En omfattende %1$sBrukerveiledning%2$s er tilgjengelig på nettstedet vårt. Nedenfor finner du noen hurtigkoblinger til viktige ressurser i dokumentasjonen.','General:'=>'Generelt:','General WordPress Settings'=>'Generelle WordPress-innstillinger','%1$s Settings'=>'%1$s Innstillinger','Working with Shortcodes:'=>'Arbeide med kortkoder:','Shortcode Overview'=>'Oversikt over kortkoder','Shortcode Builder'=>'Kortkodebygger','Shortcode Parameters Reference'=>'Referanse for kortkodeparametere','Advanced Topics:'=>'Avanserte emner:','FAQs and Tips'=>'Vanlige spørsmål og tips','CSS Guide'=>'CSS-veiledning','Developer Resources'=>'Utviklerressurser','GDPR'=>'GDPR','Appearance'=>'Utseende','Match calendar color palette to current Block Theme colors'=>'Match kalenderens fargepalett med gjeldende Block Theme-farger','beta'=>'beta','Replaces the %1$s default neutral color palette with nearest matches from the current Site Editor Styles color palette or the %2$s file in your theme. Color selections are algorithmic, and some combinations may not pass accessibility contrast tests. This setting has no effect if you are using a "classic" theme that does not include a %3$s file.'=>'Erstatter den nøytrale standardfargepaletten %1$s med de nærmeste matchende fargene fra den gjeldende fargepaletten i Site Editor Styles eller %2$s-filen i temaet ditt. Fargevalgene er algoritmiske, og det kan hende at enkelte kombinasjoner ikke består kontrasttester for tilgjengelighet. Denne innstillingen har ingen effekt hvis du bruker et "klassisk" tema som ikke inkluderer en %3$s-fil.','%1$sThis is currently a beta feature.%2$s It may require making some adjustments to your calendar settings or CSS for optimal display, especially if you have color-coded your feeds. Functionality is subject to change.'=>'%1$sDette er for øyeblikket en beta-funksjon%2$s.%2$s Det kan være nødvendig å gjøre noen justeringer i kalenderinnstillingene eller CSS for optimal visning, spesielt hvis du har fargekodet strømmene dine. Funksjonaliteten kan bli endret.','Dark mode'=>'Mørk modus','Inverts color palette (light colors on a dark background). %1$sNote:%2$s Dark mode also automatically applies style changes similar to the %3$s and %4$s shortcode parameters, so you do not need to include them in your shortcode.'=>'Inverterer fargepaletten (lyse farger på mørk bakgrunn). %1$sMerk:%2$s Mørk modus bruker også automatisk stilendringer som ligner på kortkodeparameterne %3$s og %4$s, slik at du ikke trenger å inkludere dem i kortkoden din.','Loading'=>'Laster','Always use AJAX to render calendars (recommended)'=>'Bruk alltid AJAX for å gjengi kalendere (anbefalt)','When checked, all calendars will render via AJAX (asynchronously after the page loads). This is especially useful in conjunction with other caching plugins, or if your calendars contain a large number of events. Normally, calendar data is sent directly in the HTML of the initial page load unless AJAX has been specified in the shortcode.'=>'Når dette alternativet er krysset av, vil alle kalendere gjengis via AJAX (asynkront etter at siden er lastet inn). Dette er spesielt nyttig i forbindelse med andre hurtigbufringsplugins, eller hvis kalenderne dine inneholder et stort antall hendelser. Normalt sendes kalenderdata direkte i HTML-koden ved første innlasting av siden, med mindre AJAX er spesifisert i kortkoden.','Increase memory limit when rendering calendars'=>'Øke minnegrensen ved gjengivelse av kalendere','If your calendar is failing to load with an "out of memory" fatal error, try increasing the memory limit. A minimum of 512 MB is recommended. %1$s Notes: 1) Some hosting providers may not allow applications to override the server default setting. 2) It is not possible to set this option lower than the current default memory limit on your server.'=>'Hvis kalenderen ikke kan lastes inn med en dødelig feilmelding om "tomt minne", kan du prøve å øke minnegrensen. Minimum 512 MB anbefales. %1$s Merknader: 1) Noen hostingleverandører tillater kanskje ikke at applikasjoner overstyrer serverens standardinnstilling. 2) Det er ikke mulig å sette dette alternativet lavere enn den gjeldende standardminnegrensen på serveren din.','deprecated'=>'utgått','If your site has stopped retrieving feeds after the version 11 update, turn on this option to use the legacy request method. This feature is deprecated and will be removed in an update in the near future.'=>'Hvis nettstedet ditt har sluttet å hente feeds etter versjon 11-oppdateringen, kan du slå på dette alternativet for å bruke den gamle forespørselsmetoden. Denne funksjonen er utdatert og vil bli fjernet i en oppdatering i nær fremtid.','Default shortcode'=>'Standard kortkode','If your site will include a large number of similarly configured calendar shortcodes, you can enter a default "base" shortcode here with the parameters that should be the same for all of the calendars. Individual shortcodes on the site can then include only the parameters that are unique to that calendar, as such: %1$s Any parameters included in the individual shortcode will override what is set here.'=>'Hvis nettstedet ditt kommer til å inneholde et stort antall kalenderkortkoder som er konfigurert på samme måte, kan du legge inn en standard "base"-kortkode her med parametrene som skal være de samme for alle kalenderne. Individuelle kortkoder på nettstedet kan deretter bare inneholde de parameterne som er unike for den aktuelle kalenderen, slik som dette: %1$s Eventuelle parametere som er inkludert i den individuelle kortkoden, vil overstyre det som er angitt her.','Allow access to these hostnames that resolve to reserved IP addresses'=>'Tillat tilgang til disse vertsnavnene som løser til reserverte IP-adresser','If your calendar server is hosted on the same physical server as your website, is part of the same local network, or otherwise uses a %1$sreserved IP address%2$s, enter its hostname here to allow access. For multiple calendar servers, enter one hostname per line. See %3$sthe %4$s documentation%5$s for more information.'=>'Hvis kalenderserveren din står på samme fysiske server som nettstedet ditt, er en del av samme lokale nettverk eller på annen måte bruker en %1$sreservert IP-adresse%2$s, angir du vertsnavnet her for å gi tilgang. Hvis du har flere kalenderservere, angir du ett vertsnavn per linje. Se %3$sdokumentasjonen%4$s%5$s for mer informasjon.','Enter one hostname per line. Hostnames are the base domain name, not a full URL. %1$s For example, you would enter %2$s, not %3$s.'=>'Skriv inn ett vertsnavn per linje. Vertsnavn er basisdomenenavnet, ikke en fullstendig URL-adresse. %1$s For eksempel skriver du inn %2$s, ikke %3$s.','Caching'=>'Caching','Transient (cache) expiration'=>'Forbigående (cache) utløp','seconds'=>'sekunder','Sets how long calendar feed data should be cached on the server (WordPress transients) before reloading. Default is 3600 (1 hour).'=>'Angir hvor lenge kalenderfeeddata skal bufres på serveren (WordPress-transienter) før lasting på nytt. Standard er 3600 (1 time).','Miscellaneous'=>'Diverse','Remove "Add ICS Calendar" button in Classic Editor'=>'Fjern knappen "Legg til ICS-kalender" i Classic Editor','By default, ICS Calendar adds an "Add ICS Calendar" button to the toolbar above the WYSIWYG editor when using Classic Editor. Check this box to remove the button. Has no effect on sites using the Block Editor (Gutenberg).'=>'Som standard legger ICS Calendar til en "Legg til ICS-kalender"-knapp på verktøylinjen over WYSIWYG-redigeringsprogrammet når du bruker Classic Editor. Merk av i denne boksen for å fjerne knappen. Har ingen effekt på nettsteder som bruker Block Editor (Gutenberg).','%1$s version 10.6 introduced new default values for several shortcode parameters. New installations automatically use the new default values, but upgraded installations will continue to use the old default values, unless this box is checked. Read more about these changes on %2$sour blog%3$s.'=>'%1$s versjon 10.6 introduserte nye standardverdier for flere kortkodeparametere. Nye installasjoner bruker automatisk de nye standardverdiene, men oppgraderte installasjoner vil fortsette å bruke de gamle standardverdiene, med mindre denne boksen er merket. Les mer om disse endringene på %2$sbloggen vår%3$s.','Our complete user guide is available with full translation into dozens of languages on our website:'=>'Vår komplette brukerveiledning er tilgjengelig med full oversettelse til dusinvis av språk på nettstedet vårt:','For assistance, please use our %1$ssupport request form%2$s.'=>'Hvis du trenger hjelp, kan du bruke vårt %1$sskjema for supportforespørsel%2$s.','When contacting support, please include the %1$sSystem Report%2$s from this page.'=>'Når du kontakter kundestøtte, vennligst ta med %1$sSystemrapport%2$s fra denne siden.','Spread the word!'=>'Spre ordet!!','If you find %1$s useful, you can help support our continued growth and development with a %2$sfive-star review%3$s. Thank you!'=>'Hvis du synes %1$s er nyttig, kan du bidra til å støtte vår fortsatte vekst og utvikling med en %2$sfemstjerners anmeldelse%3$s. Takk skal du ha!','%1$s Data Cache'=>'%1$s Databuffer','Clear Cached Calendar Data'=>'Tøm bufrede kalenderdata','This will immediately clear all existing cached calendar data (purge transients), forcing WordPress to reload all calendars the next time they are viewed. Caching will then resume as before.'=>'Dette vil umiddelbart fjerne alle eksisterende hurtigbufrede kalenderdata (tøm transienter), og tvinge WordPress til å laste inn alle kalendere på nytt neste gang de blir sett. Hurtigbufring vil deretter fortsette som før.','ICS Feed URL Tester'=>'ICS Feed URL Tester','If you are concerned that the plugin is not properly retrieving your feed, you can test the URL here.'=>'Hvis du er bekymret for at programtillegget ikke henter feeden din på riktig måte, kan du teste nettadressen her.','Enter feed URL...'=>'Skriv inn url-adressen til feeden...','Test URL'=>'Test URL-adresse','Results:'=>'Resultater:','%1$s received.'=>'%1$s mottatt.','This appears to be a valid ICS feed URL.'=>'Dette ser ut til å være en gyldig ICS feed URL.','This does not appear to be a valid ICS feed URL.'=>'Dette ser ikke ut til å være en gyldig ICS-feed-URL.','Could not retrieve data from the requested URL.'=>'Kan ikke hente data fra den forespurte URL-adressen.','An unknown error occurred while attempting to retrieve the requested URL.'=>'Det oppstod en ukjent feil under forsøk på å hente den forespurte URL-adressen.','Please copy the following text and include it in your message when emailing support.'=>'Kopier følgende tekst og ta den med i meldingen når du sender støtte via e-post.','Also please include the %1$s shortcode exactly as you have it entered on the affected page.'=>'Ta også med kortkoden %1$s nøyaktig slik du har skrevet den inn på den berørte siden.','For your site security please do NOT post the System Report in the support forums.'=>'Av hensyn til nettstedets sikkerhet må du IKKE legge ut systemrapporten i støtteforaene.','No events found.'=>'Ingen dager funnet.','Previous Page'=>'Forrige side','Next Page'=>'Neste side','All Day'=>'Hele dagen','Today'=>'I dag','No events.'=>'Ingen hendelser.','No additional events this month.'=>'Ingen flere hendelser denne måneden.','Last week'=>'Forrige uke','This week'=>'Nåværende uke','Next week'=>'Neste uke','ICS Calendar'=>'ICS Calendar','https://icscalendar.com'=>'https://icscalendar.com','Turn your Google Calendar, Microsoft Office 365 or Apple iCloud Calendar into a seamlessly integrated, auto-updating, zero-maintenance WordPress experience.'=>'Gjør Google Calendar, Microsoft Office 365 eller Apple iCloud Calendar om til en sømløst integrert, automatisk oppdatert WordPress-opplevelse uten vedlikehold.','Room 34 Creative Services, LLC'=>'Room 34 Creative Services, LLC']];
